pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";

abstract contract ERC1155Claimable is ERC1155, Ownable {

    mapping(address => mapping(uint => uint)) private _allowanceForClaim;

    function approveForClaim(address claimer, uint tokenId, uint amount)
    public onlyOwner {
        _allowanceForClaim[claimer][tokenId] += amount;
    }

    function claim(uint tokenId, uint amount)
    public {
        uint allowance = _allowanceForClaim[_msgSender()][tokenId];
        require(allowance >= amount, "Not approved to claim such amount");
        unchecked {
            _allowanceForClaim[_msgSender()][tokenId] -= amount;
        }
        _mint(_msgSender(), tokenId, amount, '');
    }

    function allowanceForClaim(address claimer, uint tokenId)
    view public returns (uint allowance) {
        allowance = _allowanceForClaim[claimer][tokenId];
    }

}
