    "contracts/utils/GaiminContext.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.9;

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

abstract contract GaiminContext is Context, Ownable {

    address public trustedForwarder;

    constructor(address _trustedForwarder) {
        trustedForwarder = _trustedForwarder;
    }

    function setTrustedForwarder(address newAddress)
    public onlyOwner {
        trustedForwarder = newAddress;
    }

    function isTrustedForwarder(address forwarder)
    public view virtual returns (bool) {
        return forwarder == trustedForwarder;
    }

    function _msgSender()
    internal view virtual override returns (address sender) {
        if (isTrustedForwarder(msg.sender)) {
            // The assembly code is more direct than the Solidity version using `abi.decode`.
            /// @solidity memory-safe-assembly
            assembly {
                sender := shr(96, calldataload(sub(calldatasize(), 20)))
            }
        } else {
            return super._msgSender();
        }
    }

    function _msgData()
    internal view virtual override returns (bytes calldata) {
        if (isTrustedForwarder(msg.sender)) {
            return msg.data[: msg.data.length - 20];
        } else {
            return super._msgData();
        }
    }

}
